import {useState, useRef} from "react"

let separator = { 
  display: "inline-block",
  position: "absolute",
  width: "1px",
  height: "10px",
  backgroundColor: "#4382BC"
}

function renderObject(selector, value, height, indent) {
  console.log(height)
  
  if (value === null) return (
    <div 
    onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
    onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
    style={{display: "flex"}}>
      <div style={{width: "50%", textIndent: `${indent*15+5}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", textIndent: "5px"}}>null</div>
    </div>
  )
  
  if (typeof(value) === "object") {
    console.log(value[selector])
    return (
      <div style={{cursor: "pointer"}}>
        <div 
          onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
          onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
          style={{textIndent: `${indent*15+5}px`}}>{selector}
        </div>
        <div>
          <div style={{...separator, margin: `2px 5px 0 ${indent*15+8}px`}}></div>
          {function() { 
            return Object.keys(value).map((new_selector, new_height) => (
              renderObject(new_selector, value[new_selector], new_height, indent+1)
            ))
          }()}
        </div>
      </div>
    )
  }
  
  else return (
    <div 
        onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
        onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
        style={{display: "flex"}}>
      <div style={{width: "50%", textIndent: `${indent*15+5}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", marginRight: "5px"}}>{value}</div>
    </div>
  )
  
}

//Extends FocusedDataList
export default function FocusedDataItem({itemObject}) {
  const [isDown, setIsDown] = useState(false)
  const [indent, setIndent] = useState(1)
  const arrowRef = useRef(null)
  const objectRef = useRef(null)

  return Object.keys(itemObject).map((item, i) => (
    renderObject(item, itemObject[item], i, 0)
  ))  
}
